import React from 'react'
import LeftSide from '../LeftSide/LeftSide';
import RighSide from '../RightSide/RightSide';
import ResourceSide from '../ResourceSide/ResourceSide';
import './User.css'

const User = () => {
  return (
    <div className='user-page'>
      <div className='left'><LeftSide/></div>
      <div className='resource'></div><ResourceSide className='resource'/>
      <div className='resource'></div><RighSide className='right'/>
    </div>
  )
}

export default User
